import React from 'react'

class Profile extends React.Component{
    constructor(){
        super()
        this.state = {
           renderState:false,
           userId: ''
        }
    }

    componentDidMount(){

       fetch(`http://localhost:3000/users/${this.props.userId}`)
    }

    render(){

        return(
            <div>Profile</div>
        )
    }
}

export default Profile
